INSERT [dbo].[Feedbacks] ([ID], [Name], [Email], [EmailSubject], [Message], [CreatedDate], [Status]) VALUES (21, N'ERIC JAMES', N'longkenvin101099@gmail.com', N'Nhận xét về cách pha chế cà phê CAPUCHINO', N'A cappuccino (/ˌkæpʊˈtʃiːnoʊ/ (listen); Italian pronunciation: [kapputˈtʃiːno]; Italian plural: cappuccini) is an espresso-based coffee drink that originated in Austria with later development taking place in Italy, and is prepared with steamed milk foam (microfoam).[1]

Variations of the drink involve the use of cream instead of milk, using non-dairy milk substitutes and flavoring with cinnamon or chocolate powder.[2][3] It is typically smaller in volume than a caffè latte, with a thicker layer of microfoam.[4]

The name comes from the Capuchin friars, referring to the colour of their habits,[5] and in this context referring to the colour of the beverage when milk is added in small portion to dark, brewed coffee[6] (today mostly espresso). The physical appearance of a modern cappuccino with espresso créma and steamed milk is a result of a long evolution of the drink.

The Viennese bestowed the name "Kapuziner", possibly in the 18th century, on a version that included whipped cream and spices of unknown origin. The Italian cappuccino was unknown outside Italy until the 1930s, and seems to be born out of Viennese-style cafés in Trieste and other Italian areas in Austria-Hungary through the Kapuziner coffee in the early 20th century. The drink spread from Trieste, the main coffee port in Central Europe, throughout Italy, especially after World War I and later worldwide, and can be found at a number of establishments.', CAST(N'2022-05-09T08:33:23.350' AS DateTime), 1)
GO
